import logo from './logo.svg';
import './App.css';
import Home from './components/Home';
import Navbar from './components/Navbar';

function App() {
  return (
    <main>

      <Navbar></Navbar>
      <Switch>
          <Route path="/">
            <Home />
          </Route>
      </Switch>
    </main>
  );
}

export default App;
